var session = new AprilSession(model, (result, tokens) => { string s = ""; if(result == AprilResultKind.PartialRecognition) { s = "- "; }else if(result == AprilResultKind.FinalRecognition) { s = "@ "; }else{ s = " "; } foreach(AprilToken token in tokens) { s += token.Token; } Console.WriteLine(s);
